import React from 'react';

export default class Table extends React.Component {

    constructor() {
        super()
    }

    render(props) {
        return (
            <table>
                <tr>
                    <th>name</th>
                    <th>last name</th>
                </tr>
                <tr>
                    <td>{this.props.fname}</td>
                    <td>{this.props.lname}</td>
                </tr>
            </table>
        );
    }
}
